import React, { useEffect, useState } from 'react';

const TeamPage = () => {
    const [team, setTeam] = useState([]);

    useEffect(() => {
        const fetchTeamInfo = async () => {
            // Mock данные для команды
            const data = [
                {
                    name: "Иван Иванов",
                    role: "Программист",
                    fact: "Участвовал в хакатоне по AI",
                    photo: "/images/ivan.jpg"
                },
                {
                    name: "Мария Петрова",
                    role: "Программист",
                    fact: "Любит разрабатывать игры",
                    photo: "/images/maria.jpg"
                },
                {
                    name: "Алексей Смирнов",
                    role: "Программист",
                    fact: "Создал 3 мобильных приложения",
                    photo: "/images/alexey.jpg"
                },
                {
                    name: "Светлана Кузнецова",
                    role: "Экономист",
                    fact: "Пишет статьи по аналитике данных",
                    photo: "/images/svetlana.jpg"
                },
                {
                    name: "Олег Павлов",
                    role: "Экономист",
                    fact: "Выиграл конкурс прогнозирования",
                    photo: "/images/oleg.jpg"
                },
                {
                    name: "Екатерина Фомина",
                    role: "Математик",
                    fact: "Исследует машинное обучение",
                    photo: "/images/ekaterina.jpg"
                },
            ];
            setTeam(data);
        };
        fetchTeamInfo();
    }, []);

    return (
        <div>
            <h1>Наша команда</h1>
            <div className="team-container">
                {team.map((member, index) => (
                    <div key={index} className="team-card">
                        <img src={member.photo} alt={member.name} className="team-photo" />
                        <h3>{member.name}</h3>
                        <p><strong>Роль:</strong> {member.role}</p>
                        <p><strong>Факт:</strong> {member.fact}</p>
                    </div>
                ))}
            </div>
        </div>
    );
};

export default TeamPage;
